public void linkActive()
{
    QueryBuildDataSource    qbdsInventTransOrigin;
    QueryBuildDataSource    qbdsInventTrans;
    ProdTableJour           prodTableJour;

    if (element.args().dataset() == tableNum(ProdTableJour))
    {
        prodTableJour = element.args().record() as ProdTableJour;

        qbdsInventTransOrigin = inventTransOrigin_ds.query().dataSourceTable(tableNum(InventTransOrigin));
        qbdsInventTransOrigin.clearDynalinks();

        qbdsInventTrans = inventTrans_ds.query().dataSourceTable(tableNum(InventTrans));
        qbdsInventTrans.clearDynalinks();

        if (prodTableJour.JournalType == ProdJourType::Release)
        {
            qbdsInventTrans.addDynalink(fieldNum(InventTrans, DatePhysical), prodTableJour, fieldNum(ProdTableJour, TransDate));
            qbdsInventTrans.addDynalink(fieldNum(InventTrans, VoucherPhysical), prodTableJour, fieldNum(ProdTableJour, Voucher));
        }
        else if (prodTableJour.JournalType == ProdJourType::HistoricalCost)
        {
            qbdsInventTrans.addDynalink(fieldNum(InventTrans, DateFinancial), prodTableJour, fieldNum(ProdTableJour, TransDate));
            qbdsInventTrans.addDynalink(fieldNum(InventTrans, Voucher), prodTableJour, fieldNum(ProdTableJour, Voucher));
        }
        else
        {
            qbdsInventTransOrigin.addDynalink(fieldNum(InventTransOrigin, InventTransId), prodTableJour, fieldNum(ProdTableJour, InventTransId));
        }
    }

    super();
}

public void jumpRef()
{
    if (!inventTransOrigin.jumpRefReferenceId())
    {
        super();
    }
}

void init()
{
    Query   query = new Query();

    super();

    QueryBuildDataSource qbds = query.addDataSource(tableNum(InventTransPosting));
    qbds.addDynalink(fieldNum(InventTransPosting, Voucher),
                                      inventTrans,
                                      fieldNum(InventTrans,Voucher));

    qbds.addDynalink(fieldNum(InventTransPosting, TransDate),
                                      inventTrans,
                                      fieldNum(InventTrans, DateFinancial));

    qbds.addDynalink(fieldNum(InventTransPosting, InventTransOrigin),
                                      inventTrans,
                                      fieldNum(InventTrans,InventTransOrigin));

    qbds.addRange(fieldNum(InventTransPosting,InventTransPostingType)).value(queryValue(InventTransPostingType::FinancialCharge));

    inventTransPostingFinancialCharge_DS.query(query);
}

